B.a9F=new A.c(B.ax,["Spiced carrot & lentil soup","A delicious, spicy blend, packed full of iron and low fat to boot. It's ready in under half an hour or can be made in a slow cooker.",238,11,34,7,10,"Easy","Lunch",4,0,1,"BBC Good Food","https://images.immediate.co.uk/production/volatile/sites/30/2020/08/recipe-image-legacy-id-1074500_11-ee0d41a.jpg","https://www.bbcgoodfood.com/recipes/spiced-carrot-lentil-soup",B.a3k,"\u0634\u0648\u0631\u0628\u0629 \u0627\u0644\u062c\u0632\u0631 \u0648\u0627\u0644\u0639\u062f\u0633 \u0628\u0627\u0644\u062a\u0648\u0627\u0628\u0644","\u0645\u0632\u064a\u062c \u0644\u0630\u064a\u0630 \u0648\u062d\u0627\u0631\u060c \u063a\u0646\u064a \u0628\u0627\u0644\u062d\u062f\u064a\u062f \u0648\u0642\u0644\u064a\u0644 \u0627\u0644\u062f\u0647\u0648\u0646. \u062c\u0627\u0647\u0632 \u0641\u064a \u0623\u0642\u0644 \u0645\u0646 \u0646\u0635\u0641 \u0633\u0627\u0639\u0629.",B.a4u],t.R)
B.a6X=s(["Pour tamari into a large dish and stir in curry powder, cumin, garlic and honey. Slice the chicken breasts in half horizontally, add to the marinade and mix well. Set aside in the fridge for at least 1 hr.","Mix peanut butter with chilli sauce, lime juice and 1 tbsp water to make a spoonable sauce.","Wipe a large non-stick frying pan with a little oil. Add the chicken and cook, covered, for 5-6 mins on a medium heat, turning for the last min. Set aside to rest.","Toss the lettuce with cucumber, shallot, coriander and pomegranate. Spoon over a little sauce, slice the chicken, pile on top and drizzle with remaining sauce."],t.s)
