B.a2a=s(["Preheat the oven to 180C/Gas 4. Prick the potato several times with a fork and bake for approximately 1 hour, or until soft inside.","Mix tuna with chilli, spring onion, cherry tomatoes and coriander.","Split the jacket potato and fill with the tuna mix and cottage cheese."],t.s)
