B.a6t=s(["Put pecans in a food processor and blitz to crumbs. Add raisins, peanut butter, flaxseeds, cocoa powder and agave syrup, then pulse to combine.","Shape mixture into golf ball-sized balls and roll in desiccated coconut to coat.","Put in the fridge to firm for 20 mins, then eat whenever you need a quick energy boost."],t.s)
