B.a9c=new A.c(B.ax,["Energy bites","Shape a mix of peanut butter, flaxseeds, pecans, raisins and coconut into balls for a healthy, energy-boosting snack.",204,4,10,17,10,"Easy","Snack",12,0,0,"BBC Good Food","https://images.immediate.co.uk/production/volatile/sites/30/2020/08/recipe-image-legacy-id-1026451_11-26a8789.jpg","https://www.bbcgoodfood.com/recipes/energy-bites",B.a6t,"\u0643\u0631\u0627\u062a \u0627\u0644\u0637\u0627\u0642\u0629","\u0634\u0643\u0651\u0644 \u062e\u0644\u064a\u0637\u0627\u064b \u0645\u0646 \u0632\u0628\u062f\u0629 \u0627\u0644\u0641\u0648\u0644 \u0627\u0644\u0633\u0648\u062f\u0627\u0646\u064a \u0648\u0628\u0630\u0648\u0631 \u0627\u0644\u0643\u062a\u0627\u0646 \u0648\u0627\u0644\u062c\u0648\u0632 \u0648\u0627\u0644\u0632\u0628\u064a\u0628 \u0648\u062c\u0648\u0632 \u0627\u0644\u0647\u0646\u062f \u0639\u0644\u0649 \u0634\u0643\u0644 \u0643\u0631\u0627\u062a \u0644\u0648\u062c\u0628\u0629 \u062e\u0641\u064a\u0641\u0629 \u0635\u062d\u064a\u0629.",B.a6K],t.R)
B.a57=s(["Butter and line a 30cm x 21cm tin. Preheat the oven to 180C/160C fan/gas 4.","Break up the chocolate with the butter and melt in the microwave on medium for about 5 minutes, stirring halfway through.","Beat the sugar and eggs in a bowl. Stir in the melted chocolate, add the flour and beat well.","Pour into the tin and bake for 40-45 minutes, or until the top looks papery and feels slightly wobbly. Leave to cool in the tin.","For the topping, melt chocolate with butter, stir until smooth, spread over the cake. Dust with icing sugar and cut into squares."],t.s)
B.a5_=s(["\u0627\u062f\u0647\u0646 \u0648\u0628\u0637\u0651\u0646 \u0635\u064a\u0646\u064a\u0629 30\xd721 \u0633\u0645. \u0633\u062e\u0651\u0646 \u0627\u0644\u0641\u0631\u0646 \u0639\u0644\u0649 180 \u062f\u0631\u062c\u0629.","\u0643\u0633\u0651\u0631 \u0627\u0644\u0634\u0648\u0643\u0648\u0644\u0627\u062a\u0629 \u0645\u0639 \u0627\u0644\u0632\u0628\u062f\u0629 \u0648\u0623\u0630\u0628\u0647\u0627 \u0641\u064a \u0627\u0644\u0645\u064a\u0643\u0631\u0648\u0648\u064a\u0641 \u0639\u0644\u0649 \u062d\u0631\u0627\u0631\u0629 \u0645\u062a\u0648\u0633\u0637\u0629 \u0644\u0645\u062f\u0629 5 \u062f\u0642\u0627\u0626\u0642 \u0645\u0639 \u0627\u0644\u062a\u062d\u0631\u064a\u0643.","\u0627\u062e\u0641\u0642 \u0627\u0644\u0633\u0643\u0631 \u0648\u0627\u0644\u0628\u064a\u0636 \u0641\u064a \u0648\u0639\u0627\u0621. \u0623\u0636\u0641 \u0627\u0644\u0634\u0648\u0643\u0648\u0644\u0627\u062a\u0629 \u0627\u0644\u0645\u0630\u0627\u0628\u0629 \u0648\u0627\u0644\u0637\u062d\u064a\u0646 \u0648\u0627\u062e\u0641\u0642 \u062c\u064a\u062f\u0627\u064b.","\u0627\u0633\u0643\u0628 \u0641\u064a \u0627\u0644\u0635\u064a\u0646\u064a\u0629 \u0648\u0627\u062e\u0628\u0632 \u0644\u0645\u062f\u0629 40-45 \u062f\u0642\u064a\u0642\u0629. \u0627\u062a\u0631\u0643\u0647\u0627 \u062a\u0628\u0631\u062f \u0641\u064a \u0627\u0644\u0635\u064a\u0646\u064a\u0629.","\u0644\u0644\u062a\u063a\u0637\u064a\u0629\u060c \u0623\u0630\u0628 \u0627\u0644\u0634\u0648\u0643\u0648\u0644\u0627\u062a\u0629 \u0645\u0639 \u0627\u0644\u0632\u0628\u062f\u0629 \u0648\u0627\u0641\u0631\u062f\u0647\u0627 \u0641\u0648\u0642 \u0627\u0644\u0643\u064a\u0643. \u0631\u0634\u0651 \u0627\u0644\u0633\u0643\u0631 \u0627\u0644\u0628\u0648\u062f\u0631\u0629 \u0648\u0642\u0637\u0651\u0639\u0647\u0627 \u0645\u0631\u0628\u0639\u0627\u062a."],t.s)
B.a9g=new A.c(B.ax,["Easy brownies","A gooey and delicious treat, these brownies are so easy to make. Try the rich chocolate topping for an even more decadent bake.",383,4,40,24,15,"Easy","Dessert",24,0,1,"BBC Good Food","https://images.immediate.co.uk/production/volatile/sites/30/2020/08/recipe-image-legacy-id-741511_11-b339cf2.jpg","https://www.bbcgoodfood.com/recipes/easy-brownies",B.a57,"\u0628\u0631\u0627\u0648\u0646\u064a\u0632 \u0633\u0647\u0644\u0629","\u062d\u0644\u0648\u0649 \u0644\u0632\u062c\u0629 \u0648\u0644\u0630\u064a\u0630\u0629\u060c \u0647\u0630\u0647 \u0627\u0644\u0628\u0631\u0627\u0648\u0646\u064a\u0632 \u0633\u0647\u0644\u0629 \u0627\u0644\u062a\u062d\u0636\u064a\u0631 \u062c\u062f\u0627\u064b.",B.a5_],t.R)
B.a6U=s(["Put all ingredients into a large bowl with a small pinch of sea salt and whisk well, adding your chosen sweet or savoury ingredient if you wish.","Put a large non-stick frying pan on a medium heat. Spritz with olive oil, then add a few separate tablespoons of batter.","Add your chosen fruit or veg to each pancake, then once golden on the base, gently flip over until lightly golden on the other side too.","Serve and repeat with remaining batter!"],t.s)
