B.a9k=new A.c(B.ax,["Healthy one-cup pancakes","Give these super easy and convenient pancakes a go - this recipe is an incredible way to get loads of fruit and veg in for everyone!",174,10,25,4,18,"Medium","Breakfast",4,0,0,"Jamie Oliver","https://upload.wikimedia.org/wikipedia/commons/thumb/4/40/Foodiesfeed.com_pouring-honey-on-pancakes-with-walnuts.jpg/960px-Foodiesfeed.com_pouring-honey-on-pancakes-with-walnuts.jpg","https://www.jamieoliver.com/recipes/pancakes/healthy-one-cup-pancakes/",B.a6U,"\u0628\u0627\u0646 \u0643\u064a\u0643 \u0635\u062d\u064a \u0628\u0643\u0648\u0628 \u0648\u0627\u062d\u062f","\u062c\u0631\u0651\u0628 \u0647\u0630\u0647 \u0627\u0644\u0628\u0627\u0646 \u0643\u064a\u0643 \u0627\u0644\u0633\u0647\u0644\u0629 \u0648\u0627\u0644\u0645\u0631\u064a\u062d\u0629 - \u0648\u0635\u0641\u0629 \u0631\u0627\u0626\u0639\u0629 \u0644\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0627\u0644\u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0641\u0648\u0627\u0643\u0647 \u0648\u0627\u0644\u062e\u0636\u0627\u0631!",B.a7f],t.R)
