B.a4Z=s(["Boil potatoes for 15-20 minutes until tender, then drain and mash with 2 tablespoons of milk.","Preheat oven to 200C. Put remaining milk, low-fat spread and flour into a saucepan. Bring to the boil, stirring continuously until the sauce thickens.","Stir in parsley and peas, season with pepper. Turn off the heat.","Place chunks of fish in an ovenproof dish. Pour the sauce over, then spoon mashed potato on top.","Sprinkle cheese over the whole dish and bake for 25-30 minutes until golden brown. Serve with steamed greens."],t.s)
